import { Component } from "react";

class Customer extends Component{

    
    render(){
        return(
        <div><center>
            First Name: <input type="text" placeholder="Enter your first name" required/><br></br><br></br>
            Last Name: <input type="text" placeholder="Enter your last name" required/><br></br><br></br>
            Address: <br></br><textarea rows="4" cols="30">Enter Address</textarea><br></br>
            Phone No: <input type="text"  maxLength="10" placeholder="Enter your Mobile Number" required/><br></br><br></br>
            E-mail: <input type="text" placeholder="Enter your E mail" required/><br></br><br></br>
            <input type="submit" value="ADD"/> <input type="submit" value="RESET"/>
            </center></div>
        )
    }
}

export default Customer;
